            <Route exact path="/doc/:id" component={DocumentScreen}/>
            <Route exact path="/registration" component={RegistrationScreen} />
            <Route exact path="/login" component={LoginScreen}/>
            <Route path="" component={NotFoundPage} />
          </Switch>
      <Footer/>
    </Router>
  );
}

export default App;
